import React, { useState } from 'react'
import BillingInformation from '../../components/BillingInformation/BillingInformation'
import EditPerfil from '../../components/EditPerfil/EditPerfil'
import Footer from '../../components/layout/Footer/Footer'
import Navbar from '../../components/layout/Navbar/Navbar'
import PerfilActiveSus from '../../components/PerfilActiveSus/PerfilActiveSus'
import TabsComponent from '../../components/ProfileTaps/TabsComponent'
import PerfilStyle from '../../styles/pages/Perfil/PerfilStyle'

const tabsData = {
    tabsName: 'tabs1',
    data: [
        { 
          title: 'what we Do', 
          type: 'component', 
          content:  <WhatWeDoComponent/>
        },
        { 
          title: 'how we do it', 
          type: 'component', 
          content:  <WhatWeDoComponent/>
        },
        { 
          title: 'why we do it', 
          type: 'text', 
          content: 'It’s great to have someone that understands you. We develop the best solution for your budget, schedule, and needs.'
        },
      ]
  }


function Perfil () {
    const [Seccion, setSeccion] = useState('1')
    const user = sessionStorage.getItem('userName')
    return (
        <>
        <Navbar></Navbar>
        <div className={PerfilStyle}>
            <h1 className='title'>PERFIL BIURY <span>CLUB</span></h1>
            <div className='info'>
                <TabsComponent data={tabsData}/>
            </div>
        </div>
        <Footer></Footer>
        </>
    )
}

export default Perfil
